import '../App.css';

const Home = () => {
	return (
		<div className="blog-page">
			<p>Blogsida</p>


					<ul className="blog-links">
						<li>
							<ul className="first-link">
								<a href="#">
									<div className="left-column">
										<li className="blog-date" ><span>datum</span></li>
										<li className="blog-category"><span>kategori</span></li>
									</div>
										<li className="blog-text"><h4>text</h4></li>
								</a>
							</ul>
						</li>
					</ul>
		</div>
	);
};

export default Home;
